// src/components/ProductList.js

import React from 'react';
import ProductCard from './ProductCard';

const ProductList = () => {
  const products = [
    {
      id: 1,
      name: 'Vintage Camera',
      description: 'A classic film camera perfect for photography enthusiasts.',
      image: 'https://via.placeholder.com/300x200',
      price: 149.99,
      rating: 4,
    },
    {
      id: 2,
      name: 'Wireless Headphones',
      description: 'High-quality over-ear headphones with noise cancellation.',
      image: 'https://via.placeholder.com/300x200',
      price: 299.99,
      rating: 5,
    },
    {
      id: 3,
      name: 'Fresh Apricot',
      description: 'A juicy, fresh apricot with a vibrant color and sweet taste.',
      image: 'https://thumbs.dreamstime.com/b/isolated-apricot-whole-single-fruit-leaf-white-background-fresh-closeup-217057750.jpg',
      price: 1.49,
      rating: 4,
    },
  ];

  return (
    <div className="product-list">
      {products.map((product) => (
        <ProductCard key={product.id} {...product} />
      ))}
    </div>
  );
};

export default ProductList;
